import React from "react";
import "./Navbar.css";
import logo from "../../../assets/images/logo/logo-header@2x.png";
import medicamento1 from "../../../assets/images/image-slider/working-project-sl-1.png";
import medicamento2 from "../../../assets/images/image-slider/working-project-sl-2.png";
import medicamento3 from "../../../assets/images/image-slider/working-project-sl-3.png";
import SearchIcon from "@mui/icons-material/Search";
// import SidebarSearch from '../components/Search/SidebarSearch';


import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import Container from '@mui/material/Container';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';

import { Link } from "react-router-dom";
import SidebarSearch from "../../Search/SidebarSearch";

const pages = ['Formación', 'Actualidad', 'Conócenos', 'Acceder'];
// const links = [ <Link to="/formacion"></Link>, <Link to="/actualidad"></Link>, <Link to="/conocenos"></Link> , <Link to="/ingresar"></Link>];
const settings = ['Profile', 'Account', 'Dashboard', 'Logout'];

const Navbar = () => {
  const [anchorElNav, setAnchorElNav] = React.useState(null);
  const [anchorElUser, setAnchorElUser] = React.useState(null);

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };
  const handleOpenUserMenu = (event) => {
    setAnchorElUser(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleCloseUserMenu = () => {
    setAnchorElUser(null);
  };

  return (
    <div id="navbar-container">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ mr: 2, display: { xs: 'none', md: 'flex' } }}
          >
             <a href="index.html" rel="home" className="main-logo">
                <img src={logo} alt="images" id="logo" />
              </a>
              <div id="wrapper" className="animsition">
      <nav id="main-nav" className="main-nav">
        <Link to="/" className="material-icons">
          <div id="site-logo" className="clearfix">
            <div id="site-log-inner">
              <a href="index.html" rel="home" className="main-logo">
                <img src={logo} alt="images" id="logo" />
              </a>
            </div>
          </div>
        </Link>
        <ul id="menu-primary-menu" className="menu">
          <li className="menu-item menu-item-has-children" id="medicamentos">
            <a href="#" id="first-left">
              Medicamentos
            </a>
            <ul className="sub-menu" id="medicamentos-ul">
              <li className="menu-item" id="dropdown1">
                <a href="#" className="a-submenu">
                  Medicamento 1
                </a>
                <ul className="sidedrop">
                  <li className="menu-item-secondary" id="dropdown1-1">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba1{" "}
                    </a>
                    <ul className="sidedrop-3">
                      <li className="menu-item">
                        <a href="product_detail.html">
                          <img src={medicamento1} /> Medicamento 1
                        </a>
                      </li>
                    </ul>
                  </li>
                  <li className="menu-item" id="dropdown1-2">
                    {" "}
                    <a href="product_detail.html" className="a-submenu">
                      {" "}
                      Prueba2{" "}
                    </a>
                    <ul className="sidedrop-3">
                      <li className="menu-item">
                        <a href="product_detail.html">
                          <img src={medicamento2} /> Medicamento 2
                        </a>
                      </li>
                    </ul>
                  </li>
                  <li className="menu-item" id="dropdown1-3">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba3{" "}
                    </a>
                    <ul className="sidedrop-3">
                      <li className="menu-item">
                        <a href="product_detail.html">
                          <img src={medicamento3} /> Medicamento 3
                        </a>
                      </li>
                    </ul>
                  </li>
                </ul>
              </li>
              <li className="menu-item" id="dropdown2">
                <a href="#" className="a-submenu">
                  Medicamento 2
                </a>
                <ul className="sidedrop">
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba1{" "}
                    </a>
                  </li>
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba2{" "}
                    </a>
                  </li>
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba3{" "}
                    </a>
                  </li>
                </ul>
                <ul className="sidedrop">
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba1{" "}
                    </a>
                  </li>
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba2{" "}
                    </a>
                  </li>
                  <li className="menu-item">
                    {" "}
                    <a href="#" className="a-submenu">
                      {" "}
                      Prueba3{" "}
                    </a>
                  </li>
                </ul>
              </li>
            </ul>
          </li>
          <li className="menu-item menu-item-has-children">
            <a href="#">Higiene</a>
            <ul className="sub-menu">
              <li className="menu-item">
                <a href="#">Higiene 1</a>
              </li>
              <li className="menu-item">
                <a href="#">Higiene 2</a>
              </li>
            </ul>
          </li>
          <li className="menu-item menu-item-has-children">
            <a href="#">Alimentación</a>
            <ul className="sub-menu">
              <li className="menu-item">
                <a href="#">Alimentación 1</a>
              </li>
              <li className="menu-item">
                <a href="#">Alimentación 2</a>
              </li>
            </ul>
          </li>
          <li className="menu-item menu-item-has-children" id="last-left">
            <a href="#">Fungibles</a>
            <ul className="sub-menu">
              <li className="menu-item">
                <a href="#">Fungible 1</a>
              </li>
              <li className="menu-item">
                <a href="#">Fungible 2</a>
              </li>
            </ul>
          </li>

          <li className="menu-item right icon">
            <Link to="/ingresar" >
              Acceder
            </Link>
          </li>
          <li className="menu-item right icon">
            <a href="#" className="header-menu header-menu-trigger">
              {" "}
              <SearchIcon />{" "}
            </a>
          </li>

          <li className="menu-item right">
            <Link to="/formacion">Formación</Link>
          </li>
          <li className="menu-item right">
            <Link to="/actualidad">Actualidad</Link>
          </li>
          <li className="menu-item right">
            <Link to="/conocenos">Conócenos</Link>
          </li>
        </ul>
      </nav>
    </div>
          </Typography>

          <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            <IconButton
              size="large"
              aria-label="account of current user"
              aria-controls="menu-appbar"
              aria-haspopup="true"
              onClick={handleOpenNavMenu}
              color="inherit"
            >
              <MenuIcon />
            </IconButton>
          </Box>

          <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            {pages.map((page) => (
              <Button
                key={page}
                onClick={handleCloseNavMenu}
                sx={{ my: 2, color: 'black', display: 'block' }}
              >
                {page}
              </Button>
            ))}
          </Box>
          <SidebarSearch/>
        </Toolbar>
      </Container>
    </div>
  );
};
export default  Navbar;
